var title_f26_26_27046="Trichiasis and sequelae";
var content_f26_26_27046=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F62649&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F62649&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Cicatricial disease: trichiasis and its sequelae",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 271px; height: 539px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Panel A) WHO grade TT. To make a diagnosis of TT, there must be evidence of at least one ingrown eyelash touching the globe, or evidence of epilation (eyelash removal). Trichiasis occurs when eyelid conjunctiva scar tissue contracts, distorting the lid margin and causing the eyelashes to rub on the cornea. Panel B) Pannus. Pannus is the growth of vascular tissue over the cornea as a result of edema and ulceration due to eyelash abrasion on the cornea. It is a hallmark of trachoma but is not assessed in the current grading system. Panel C) WHO grade CO. To make a diagnosis of CO, there must be evidence of corneal opacity blurring part of the pupil margin.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
