" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Inborn errors of metabolism: Classification",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?26/26/27047/contributors\">",
