"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?26/26/27047/contributors\">",
"     V Reid Sutton, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?26/26/27047/contributors\">",
"     Section Editors",
"    </a>",
