"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?26/26/27047/contributors\">",
"     Sihoun Hahn, MD, PhD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?26/26/27047/contributors\">",
"     Joseph A Garcia-Prats, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
