"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?25/43/26298?source=related_link\">",
"      Epidemiology, clinical manifestations, and diagnosis of HIV-associated lipodystrophy",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?25/26/26024?source=related_link\">",
"      Injectable soft tissue fillers: Permanent agents",
